void BVerbAudioProcessorEditor::onParameterUpdated(const teragon::Parameter *parameter) {
    if(parameter->getName() == "IR") {
        MessageManager::getInstance()->callFunctionOnMessageThread(BVerbAudioProcessorEditor::importFile, this);
    }
    else if (parameter->getName() == "MicTechBlum" && parameter->getValue() == true) {
        pluginMode = 1;
        parameters.set("azimuth1", 0.0f);
        parameters.set("azimuth2", 0.0f);
        parameters.set("elevation1", 0.0f);
        parameters.set("elevation2", 0.0f);
        polarPatOchoPushButton1->setToggleState(true, sendNotification);
        polarPatOchoPushButton2->setToggleState(true, sendNotification);
        azimuthKnob2->setEnabled(false);
        elevationKnob2->setEnabled(false);
        polarPatOmniPushButton1->setEnabled(false);
        polarPatCardPushButton1->setEnabled(false);
        polarPatSuperPushButton1->setEnabled(false);
        polarPatOchoPushButton1->setEnabled(false);
        polarPatOmniPushButton2->setEnabled(false);
        polarPatCardPushButton2->setEnabled(false);
        polarPatSuperPushButton2->setEnabled(false);
        polarPatOchoPushButton2->setEnabled(false);
    }
    else if (parameter->getName() == "MicTechXY" && parameter->getValue() == true) {
        pluginMode = 2;
        parameters.set("azimuth1", 0.0f);
        parameters.set("azimuth2", 0.0f);
        parameters.set("elevation1", 0.0f);
        parameters.set("elevation2", 0.0f);
        polarPatCardPushButton1->setToggleState(true, sendNotification);
        polarPatCardPushButton2->setToggleState(true, sendNotification);
        azimuthKnob2->setEnabled(false);
        elevationKnob2->setEnabled(false);
        polarPatOmniPushButton1->setEnabled(false);
        polarPatCardPushButton1->setEnabled(false);
        polarPatSuperPushButton1->setEnabled(false);
        polarPatOchoPushButton1->setEnabled(false);
        polarPatOmniPushButton2->setEnabled(false);
        polarPatCardPushButton2->setEnabled(false);
        polarPatSuperPushButton2->setEnabled(false);
        polarPatOchoPushButton2->setEnabled(false);
    }
    else if (parameter->getName() == "MicTechMidSide" && parameter->getValue() == true) {
        pluginMode = 3;
        parameters.set("azimuth1", 0.0f);
        parameters.set("azimuth2", 0.0f);
        parameters.set("elevation1", 0.0f);
        parameters.set("elevation2", 0.0f);
        polarPatCardPushButton1->setToggleState(true, sendNotification);
        polarPatOchoPushButton2->setToggleState(true, sendNotification);
        azimuthKnob2->setEnabled(false);
        elevationKnob2->setEnabled(false);
        polarPatOmniPushButton1->setEnabled(false);
        polarPatCardPushButton1->setEnabled(false);
        polarPatSuperPushButton1->setEnabled(false);
        polarPatOchoPushButton1->setEnabled(false);
        polarPatOmniPushButton2->setEnabled(false);
        polarPatCardPushButton2->setEnabled(false);
        polarPatSuperPushButton2->setEnabled(false);
        polarPatOchoPushButton2->setEnabled(false);
    }
    else if (parameter->getName() == "MicTechFree" && parameter->getValue() == true) {
        pluginMode = 4;
        parameters.set("azimuth1",  0.0f);
        parameters.set("azimuth2",  0.0f);
        parameters.set("elevation1", 0.0f);
        parameters.set("elevation2", 0.0f);
        polarPatOmniPushButton1->setToggleState(true, sendNotification);
        polarPatOmniPushButton2->setToggleState(true, sendNotification);
        azimuthKnob2->setEnabled(true);
        elevationKnob2->setEnabled(true);
        polarPatOmniPushButton1->setEnabled(true);
        polarPatCardPushButton1->setEnabled(true);
        polarPatSuperPushButton1->setEnabled(true);
        polarPatOchoPushButton1->setEnabled(true);
        polarPatOmniPushButton2->setEnabled(true);
        polarPatCardPushButton2->setEnabled(true);
        polarPatSuperPushButton2->setEnabled(true);
        polarPatOchoPushButton2->setEnabled(true);
    }
    else if (parameter->getName() == "azimuth1") {
        if (pluginMode == 1){
            processor.virtualMicSynthL->set_theta(parameters.get("azimuth1")->getValue() - 45.0f);
            processor.virtualMicSynthR->set_theta(parameters.get("azimuth1")->getValue() + 45.0f);
        }else if (pluginMode == 2){
            processor.virtualMicSynthL->set_theta(parameters.get("azimuth1")->getValue() - 45.0f);
            processor.virtualMicSynthR->set_theta(parameters.get("azimuth1")->getValue() + 45.0f);
        }else if (pluginMode == 3){
            processor.virtualMicSynthL->set_theta(parameters.get("azimuth1")->getValue());
            processor.virtualMicSynthR->set_theta(parameters.get("azimuth1")->getValue() - 90.0f);
        }else if (pluginMode == 4){
            processor.virtualMicSynthL->set_theta(parameters.get("azimuth1")->getValue());
        }
        UIResynthFlag = true;
    }
    else if (parameter->getName() == "elevation1") {
        if (pluginMode == 4){
            processor.virtualMicSynthL->set_phi(parameters.get("elevation1")->getValue());
        }else {
            processor.virtualMicSynthL->set_phi(parameters.get("elevation1")->getValue());
            processor.virtualMicSynthR->set_phi(parameters.get("elevation1")->getValue());
        }
        UIResynthFlag = true;
    }
    else if (parameter->getName() == "azimuth2") {
        if (pluginMode == 4) {
            processor.virtualMicSynthR->set_theta(parameters.get("azimuth2")->getValue());
            UIResynthFlag = true;
        }
    }
    else if (parameter->getName() == "elevation2") {
        if (pluginMode == 4) {
            processor.virtualMicSynthR->set_phi(parameters.get("elevation2")->getValue());
            UIResynthFlag = true;
        }
    }
    else if (parameter->getName() == "polarOmni1") {
        processor.virtualMicSynthL->set_d(0.0f);
        UIResynthFlag = true;
    }
    else if (parameter->getName() == "polarOmni2") {
        processor.virtualMicSynthR->set_d(0.0f);
        UIResynthFlag = true;
    }
    else if (parameter->getName() == "polarCard1") {
        processor.virtualMicSynthL->set_d(1.0f);
        UIResynthFlag = true;
    }
    else if (parameter->getName() == "polarCard2") {
        processor.virtualMicSynthR->set_d(1.0f);
        UIResynthFlag = true;
    }
    else if (parameter->getName() == "polarSuper1") {
        processor.virtualMicSynthL->set_d(1.5f);
        UIResynthFlag = true;
    }
    else if (parameter->getName() == "polarSuper2") {
        processor.virtualMicSynthR->set_d(1.5f);
        UIResynthFlag = true;
    }
    else if (parameter->getName() == "polarOcho1") {
        processor.virtualMicSynthL->set_d(2.0f);
        UIResynthFlag = true;
    }
    else if (parameter->getName() == "polarOcho2") {
        processor.virtualMicSynthR->set_d(2.0f);
        UIResynthFlag = true;
    }
}

//==============================================================================
void* BVerbAudioProcessorEditor::importFile(void *editorPtr) {
    BVerbAudioProcessorEditor *editor = (BVerbAudioProcessorEditor*)editorPtr;
    teragon::Parameter *lastIRLocation = editor->parameters["IR Path"];

    FileChooser fc ("Choose a .wav file to open... ",File::getSpecialLocation(File::SpecialLocationType::userHomeDirectory),"*.wav");
    if(fc.browseForFileToOpen()) {
        String chosen;
        chosen << fc.getResult().getFullPathName();

        //......................    CODIGO PARA PODER USAR IR SINTETIZADA CON MIC VIRTUAL .............................
        editor->parameters.setData(lastIRLocation, chosen.toRawUTF8(), (const size_t)chosen.length());
        editor->processor.IRLoader->readFile(chosen);

        editor->processor.convkernells[editor->processor.getDummyIndex()]->prepareForIRLoad(editor->processor.IRLoader->getIRSize());
        editor->processor.virtualMicSynthL->synth(editor->processor.IRLoader->getIRSize(), editor->processor.IRLoader->getReadPointer2Channel(1), editor->processor.IRLoader->getReadPointer2Channel(2), editor->processor.IRLoader->getReadPointer2Channel(3), editor->processor.IRLoader->getReadPointer2Channel(0), editor->processor.convkernells[editor->processor.getDummyIndex()]->getIrAudioBufferPointer(0));
        editor->processor.virtualMicSynthR->synth(editor->processor.IRLoader->getIRSize(), editor->processor.IRLoader->getReadPointer2Channel(1), editor->processor.IRLoader->getReadPointer2Channel(2), editor->processor.IRLoader->getReadPointer2Channel(3), editor->processor.IRLoader->getReadPointer2Channel(0), editor->processor.convkernells[editor->processor.getDummyIndex()]->getIrAudioBufferPointer(1));
        editor->processor.convkernells[editor->processor.getDummyIndex()]->resetPartitions();

        editor->parameters.set("irLoaded", true);

        editor->processor.changeConvKernellFlag = true;
        editor->processor.prepareForFutureSynthFlag = true;

    }
    return nullptr;
}

